('8', 'Новый шаблон', '\n\n\n	<meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n	<title>HTML Template</title>\n	<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\n	<style>\n		body {\n			width: 100% !important;\n			-webkit-text-size-adjust: 100%;\n			-ms-text-size-adjust: 100%;\n			margin: 0;\n			padding: 0;\n			line-height: 100%;\n		}\n\n		img {\n			outline: none;\n			text-decoration: none;\n			border:none;\n			-ms-interpolation-mode: bicubic;\n			max-width: 100%!important;\n			margin: 0;\n			padding: 0;\n			display: block;\n		}\n    \n		table td {\n			border-collapse: collapse;\n		}\n    \n		table {\n			border-collapse: collapse;\n			mso-table-lspace: 0pt;\n			mso-table-rspace: 0pt;\n		}\n	</style>\n\n\n\n	<table cellpadding=\"0\" cellspacing=\"0\" width=\"100%\" style=\"background-color: rgba(0, 0, 0, 0); background-size: 100%;\">\n		<tbody><tr>\n                      <td align=\"center\">\n                               <table align=\"center\" cellpadding=\"0\" cellspacing=\"0\" width=\"540\" border=\"0\" style=\"max-width: 540px; min-width: 540px; background-color: rgb(255, 255, 255);\">\n                                        <tbody>\n                                    <tr><td style=\"padding: 10px\" align=\"center\"><p>Новая строка</p></td><td style=\"padding: 10px;\" align=\"center\"><p><span>Новая ячейка</span></p></td><td style=\"padding: 10px;\" align=\"center\"><p>Новая ячейка</p></td></tr></tbody></table>\n                      </td>\n                </tr>\n	</tbody></table>\n\n\n'),
