('14', '207', '1', '16', '2', '<p>Прекрасное кафе!!!</p>\n<p>но <span style=\"font-size: 18pt; color: rgb(0, 0, 0);\"><strong>кофе </strong></span>- говнячий <span style=\"font-family: \'arial black\', sans-serif;\">конечно...</span></p>', '2.290000', '2023-10-22 22:02:06', '2024-02-14 15:07:31', 'продукт', NULL),
('15', '208', '1', '5', '2', '<p>Продавец - добрейшей души человек!!!</p>\n<p>Хотел купить у него машину, но предложил подарить. <strong><span style=\"font-family: \'comic sans ms\', sans-serif;\">Очень мучает совесть, думаю не смогу принять такой подарок.</span>&nbsp;</strong></p>\n<p>Но было приятно!!! )))))</p>', '4.980000', '2023-10-23 14:50:27', '2024-02-14 15:09:14', 'продукт', NULL),
