INSERT INTO `shops_categorys` (`id`, `category`, `descr`, `logo`, `logo_img`, `cat_trans`, `order`, `title`, `keywords`, `banner`, `h1`) VALUES
('1', 'Услуги', 'объявления об услугах в [текущий город]е. На [название сайта] вы можете заказать услуги мастеров по ремонту, репетиторов, парикмахеров, спортивных тренеров, курьеров и других специалистов услуг, а также посмотреть отзывы и фотографии с примерами работ, договориться о стоимости и вызвать на дом нужных специалистов. Выбирайте среди предложений компаний и частных объявлений об услугах на [название сайта]', '20230531-225030_id-2-530854.svg', '20230531-090353_id-2-829880.png', 'services', '4', 'Услуги и сервисы в [текущий город]е| Поиск специалистов | Услуги на [название сайта]', NULL, '-', '-'),
('2', 'Работа', 'объявления о вакансиях и резюме в [текущий город]е. На [название сайта] вы можете найти свежие вакансии от прямых работодателей, работу для женщин и мужчин с разным опытом, вакансии с гибким, сменным графиком и на полный день, а также подработку. Работодателям доступна база резюме кандидатов: находите соискателей с нужными навыками и опытом, приглашайте их на собеседование и выбирайте, кого нанять на работу. Объявления о поиске работы и персонала на [название сайта].', '20230531-225030_id-2-957282.svg', '20230531-090337_id-2-799191.png', 'work', '2', 'Работа в [текущий город]е: свежие вакансии, поиск персонала, база резюме | Вакансии и резюме | [название сайта]', NULL, '-', '-'),
('3', 'Недвижимость', 'Объявления о продаже, покупке и аренде недвижимости в городе [текущий город]. На сайте [название сайта] вы можете недорого купить или снять квартиру, комнату, загородный дом, помещение для бизнеса. Цены на недвижимость в городе [текущий город]. Выбирайте предложения без посредников от собственников или проверенных агентств. Поиск на карте, по району, цене, площади и другим параметрам.', '20230531-225030_id-2-911077.svg', '20230531-090326_id-2-618735.png', 'real-estate', '1', '[категория] в [текущий город]: квартиры, дома, коммерческая недвижимость, земля | Продажа и аренда недвижимости | [название сайта]', NULL, '-', '-'),
('4', 'Транспорт', 'объявление о продаже автомобилей, мотоциклов, коммерческого и водного транспорта по низким ценам в городе [текущий город]е. На сайте [название сайта] вы можете недорого купить новые и подержанные автомобили, мотоциклы, грузовики и другую спецтехнику, а также запчасти к ним. Выбирайте среди предложений компаний и частных объявлений о продаже транспорта и запчастей на сайте [название сайта]', '20230531-225030_id-2-271824.svg', '20230531-090249_id-2-762660.png', 'transport', '0', '[категория] в городе [текущий город]е: автомобили, мотоциклы, спецтехника, запчасти | Новый и б/у транспорт |[название сайта]', '', '-', 'Транспорт и запчасти в городе [текущий город]'),
('5', 'Одежда', 'Объявления о продаже одежды в [текущий город] с доставкой.На [название сайта] вы можете купить женскую и мужскую одежду разных размеров по доступным ценам. Частные предложения и объявления магазинов о продаже недорогих новых и б/у вещей.', '20230531-225030_id-2-883025.svg', '20230531-090405_id-2-894901.png', 'odejda', '3', 'Купить недорого одежду в [текущий город] с доставкой |[название сайта]', NULL, '-', '-'),
('6', 'Дом', 'Объявления о продаже товаров для дома  по доступным ценам в[текущий город]. На [название сайта] вы можете недорого купить товары для ремонта и строительства, бытовую технику, мебель, посуду, растения и продукты питания. Выбирайте среди предложений магазинов и частных объявлений о продаже товаров для дома на [название сайта]', '20230531-225030_id-2-681991.svg', '20230531-103217_id-2-140827.png', 'dom', '16', 'Купить товары для дома  в [текущий город]| [название сайта]', NULL, '-', 'Товары для дома в городе [текущий город]'),
('7', 'Электроника', ' Объявления о продаже электроники по доступным ценам в [текущий город]е. На [название сайта ] вы можете недорого купить новые и б/у телефоны, планшеты, аудио- и видеотехнику, компьютеры, ноутбуки, фотоаппараты и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже электронной техники на [название сайта].', '20230531-225030_id-2-727879.svg', '20230531-103149_id-2-515674.png', 'elektronika', '6', 'Купить недорого электронику в [текущий город]е | [название сайта]', NULL, '-', '-'),
('8', 'Спорт, отдых, путешествия', 'Объявления о продаже товаров для спорта и активного отдыха по доступным ценам в [текущий город]. На  [название сайта] вы можете недорого купить новые и б/у беговые дорожки, ролики, коньки, лыжи, бильярдные столы, снаряжение для дайвинга, боксёрские перчатки, футбольные и волейбольные мячи, настольные игры для детей и взрослых. Выбирайте среди предложений магазинов и частных объявлений о продаже недорогих спортивных товаров и оборудования на [название сайта].', '20230531-225030_id-2-301175.svg', '20230531-103121_id-2-869985.png', 'sport-otdyh-puteshestviya', '11', 'Купить товары для спорта и отдыха в [текущий город]: коньки, ролики, бильярд, снаряжение для дайвинга, мячи | Недорогие спортивные товары | [название сайта]', NULL, '-', 'Товары для спорта, отдыха, путешествия в городе [текущий город]'),
('9', 'Животные и зоотовары', 'Объявления о продаже животных по доступным ценам в [текущий город]. На [название сайта] вы можете недорого купить домашних и сельскохозяйственных животных: грызунов, кроликов, хорьков, рептилий, улиток, коров, лошадей и других. Выбирайте среди частных объявлений и предложений питомников и заводчиков о продаже домашних и сельскохозяйственных животных, а также зоотовары', '20230531-225030_id-2-583418.svg', '20230814-193633_id-2-188250.png', 'jivotnye-i-zootovary', '12', 'Домашние и сельскохозяйственные животные, зоотовары: купить недорого в городе [текущий город]| [название сайта]', NULL, '-', '-'),
('10', 'Бизнес и для бизнеса', 'Объявления о продаже готового бизнеса и профессионального оборудования в [текущий город]. На [название сайта] вы можете недорого купить готовый бизнес и оборудование для бизнеса.', '20230531-225030_id-2-936033.svg', '20230814-193711_id-2-798010.png', 'biznes-i-dlya-biznesa', '9', 'Готовый бизнес и оборудование в [текущий город]| Покупка и продажа бизнеса | [название сайта]', NULL, '-', 'Готовый бизнес и оборудование для бизнеса в городе [текущий город]'),
('11', 'Запчасти и аксессуары', 'Объявления о продаже запчастей и аксессуаров для автомобилей и мотоциклов в [текущий город] на [название сайта]. Вы можете купить новые и б/у запчасти и аксессуары по низким ценам. Большой выбор авто- и мотозапчастей в  [текущий город] и других регионах.', '20230531-225030_id-2-920251.svg', '20230814-193759_id-2-494682.png', 'zapchasti-i-aksessuary', '8', 'Купить запчасти и аксессуары для машин и мотоциклов в [текущий город] |[название сайта]', NULL, '-', 'Запчасти и аксессуары для машин и мотоциклов в городе [текущий город]'),
('14', 'Продукты', ' Объявления о продаже продуктов по доступным ценам в [текущий город]. На [название сайта] вы можете недорого купить фрукты, овощи, орехи, мёд, мясо и птицу, рыбу и икру, молочные продукты, домашние консервы. Выбирайте среди предложений магазинов, фермерских хозяйств и частных объявлений о продаже продуктов питания.', '20230727-192526_id-2-878749.svg', '20230814-193724_id-2-905853.png', 'produkty', '13', 'Купить продукты питания в [текущий город]| Недорогие продукты |[название сайта]', NULL, '-', 'Продажа продуктов питания в городе [текущий город]'),
('18', 'Красота, здоровье, аптека', 'Объявления об услугах в сфере красоты здоровья в [текущий город]. Подать объявление об услугах и товарах по уходу за красотой и здоровьем в [текущий город]. Доска объявлений [название сайта]', '20230508-154105_id-2-312764.svg', '20231203-153912_id-2-955590.jpg', 'krasota-zdorove-apteka', '10', 'Объявления о продаже товаров и услуг для красоты и здоровья в [текущий город], на [название сайта]', NULL, '-', '-'),
('19', 'Бытовая техника', 'Объявления о продаже бытовой техники по доступным ценам в [текущий город]. На [название сайта] вы можете недорого купить новые и б/у холодильники, стиральные машины, пылесосы, микроволновые печи и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже домашней бытовой техники на [название сайта].', '20230508-154105_id-2-312764.svg', '20231203-153721_id-2-850996.jpg', 'bytovaya-tehnika', '7', 'Купить бытовую технику в  [текущий город]. Недорогая техника для дома | [название сайта]', NULL, '-', '-'),
('20', 'Аксессуары', 'Объявления о продаже женских и мужских аксессуаров в [текущий город] с доставкой. На  [название сайта] вы можете купить головные уборы, платки, шарфы, очки, ремни, носки, колготки, зонты, украшения и многое другое по доступным ценам. Частные предложения и объявления магазинов о продаже недорогих новых и б/у вещей.', '20230508-154105_id-2-312764.svg', '20231204-135805_id-2-732205.jpg', 'aksessuary', '14', ' Купить аксессуары для женщин и мужчин [текущий город] с доставкой: головные уборы, очки, ремни, украшения | [название сайта]', NULL, '-', '-'),
('21', 'Игрушки', 'Объявления о продаже игрушек и детских товаров в городе [текущий город] с доставкой. На сайте [название сайта] вы можете купить детскую мебель и коляски, автокресла, велосипеды и самокаты, постельные принадлежности, товары для кормления и купания, школьные товары и многое другое по доступным ценам. Частные предложения и объявления магазинов о продаже недорогих новых и б/у товаров для детей с фотографиями и описанием.\"-', '20230508-154105_id-2-312764.svg', '20231203-152249_id-2-142945.webp', 'igrushki', '20', 'Купить недорого игрушки и товары для детей в городе [текущий город] с доставкой | Детские вещи | [название сайта]', NULL, '-', '-'),
('22', 'Мебель', 'объявления о продаже мебели и предметов интерьера по доступным ценам в [текущий город]. На Авито вы можете недорого купить кровати, диваны, столы и стулья, шкафы, мебель для ванной, ковры и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже недорогих новых и б/у товаров для дома и дачи.', '20230508-154105_id-2-312764.svg', '20231203-154443_id-2-765443.jpg', 'mebel', '18', 'Купить мебель в [текущий город]: кровати, диваны, стулья, столы | Недорогие товары для дома и дачи | [название сайта]', NULL, '-', '-'),
('23', 'Товары для взрослых ', 'Интимные товары для взрослых: купить в городе [текущий город] — частные объявления на  доске бесплатных объявлений. [название сайта] — доска объявлений в вашем городе.', '20230508-154105_id-2-312764.svg', '20231204-135708_id-2-631750.webp', 'tovary-dlya-vzroslyh', '15', 'Интимные товары для взрослых: купить новые или б/у в городе  [текущий город] - объявления о продаже на сайте [название сайта]', NULL, '-', '-'),
('25', 'Строительство и ремонт', 'Объявления о продаже товаров для ремонта и строительства по доступным ценам в [текущий город]. На  [название сайта] вы можете недорого купить межкомнатные и входные двери, пластиковые окна, смесители, унитазы, ванны, стройматериалы, обогреватели, радиаторы и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже недорогих новых и б/у товаров для дома и дачи на [название сайта].', '20230508-154105_id-2-312764.svg', '20230814-193655_id-2-201574.png', 'stroitelstvo-i-remont', '21', 'Купить товары для ремонта и строительства в [текущий город]| Недорогие товары для дома и дачи | [название сайта]', NULL, '-', 'Товары для ремонта и строительства в городе [текущий город]'),
('26', 'Сад и дача', 'Объявления о продаже товаров для сада и дачи  по доступным ценам в[текущий город]. На [название сайта] вы можете недорого купить товары для ремонта и строительства, бытовую технику, мебель, посуду, растения и продукты питания. Выбирайте среди предложений магазинов и частных объявлений о продаже товаров для дома на [название сайта]', '20230508-154105_id-2-312764.svg', '20231204-135535_id-2-375034.jpg', 'sad-i-dacha', '17', 'Купить для товары для дачи и сада  в [текущий город]| [название сайта]', NULL, '-', 'Товары для сада и дачи в городе [текущий город]'),
('27', 'Канцтовары ', 'Объявления о продаже канцелярских товаров по доступным ценам в [текущий город] с доставкой.  На [название сайта] вы можете недорого купить новые или б/у калькуляторы для дома или офиса, органайзеры для документов, печатные машинки, визитницы и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже канцтоваров на [название сайта]', '20230508-154105_id-2-312764.svg', '20231203-154603_id-2-391644.jpg', 'kanctovary', '19', 'Купить канцтовары ✏️ в [текущий город] с доставкой | Недорогая оргтехника и расходники | [название сайта]', NULL, '-', '-'),
('30', 'Обувь ', 'Объявления о продаже обуви в [текущий город]е с доставкой.На [название сайта] вы можете купить женскую и мужскую, детскую обувь разных размеров по доступным ценам. Частные предложения и объявления магазинов о продаже недорогих новых и б/у вещей.', '20230508-154105_id-2-312764.svg', '20231203-153628_id-2-943438.jpg', 'obuv', '5', 'Купить недорого обувь в [текущий город]е с доставкой |[название сайта]', NULL, '-', '-'),
