('33', 'Цветы', ' Объявления о продаже растений по доступным ценам в  [текущий город] На [название сайта] вы можете недорого купить комнатные цветы и садовые растения, рассаду, саженцы, семена и многое другое. Выбирайте среди предложений магазинов и частных объявлений о продаже недорогих товаров для дома и дачи на [название сайта]', '20230508-154105_id-2-312764.svg', '20231203-141501_id-2-809731.jpg', 'cvety', '23', 'Цветы розы и букеты с доставкой - Купить растения  в [текущий город]: цветы, саженцы, рассада | Недорогие товары для дома и дачи | [название сайта]', NULL, '-', '-');
