('71', './TEMPLATES/list_cards_product.php', 'slider', 's:2893:\"<?php\nINCLUDE_CLASS(\'shops\', \'favorite\');\n\n//wtf($preview_cards_product, 1);\n\n$preview_cards_product = FAVORITE::verify_like_products($preview_cards_product, Access::userID(), \'id_shop\', \'id_product\');\n\nif(Access::scanLevel() < 1) {\n    $basket = $_COOKIE[\'basket\'] ?? \'\';\n} else {\n    $basket = $_COOKIE[\'basket-id-user\'] ?? \'\';\n}\n\nif(isset($basket) && $basket !== \'\') {\n    $B = new BASKET($basket);\n    $preview_cards_product = $B->verify_in_basket_product($preview_cards_product);\n} else {\n    foreach($preview_cards_product as $k=>$v) {\n        $v[\'IN_BASKET\'] = 0;\n        $preview_cards_product[$k] = $v;\n    }\n}\n?>\n\n<section class=\"wrapper products-list\">\n    <h2 class=\"h2\" style=\"margin-bottom: 20px\"><?php if(isset($title)) { echo $title; } else echo \'Рекомендовано для Вас\'; ?></h2>\n    <ul>\n        <?php\n        foreach($preview_cards_product as $k=>$v) {\n            $shop_id = (int)explode(\'_\', $k)[0];\n            $product_id = (int)$v[\'id_product\'];\n            echo \'<li data-id=\"\'.$k.\'\" data-name=\"\'.$v[\'trans\'].\'\" data-list=\"\'.$v[\'action_list_trans\'].\'\">\';\n            if(isset($v[\'FILES\'][0])) {\n                echo \'<img loading=\"lazy\" width=\"333\" height=\"226\" src=\"/IMG/img300x300/\'.$v[\'FILES\'][0].\'\">\';\n            }\n            $hart = \'\';\n            if($v[\'LIKE\'] == 1) {\n                $hart = \'hart-red\';\n            }\n\n            echo \'<div class=\"text-info\">\';\n            echo \'<div class=\"wrapper-link flex between gap-5\"><a href=\"/\'.$v[\'main_cat_trans\'].\'/\'.$v[\'under_cat_trans\'].\'/\'.VALUES::translit($v[\'action_list_trans\']).\'/\'.$v[\'trans\'].\'?s=\'.$shop_id.\'&prod=\'.$product_id.\'\">\'.$v[\'name\'].\'</a>\';\n            if(!SHOP::is_my_shop($shop_id) && Access::userID() > 0) {\n                echo \'<button onclick=\"favorite_check(this, \' . $shop_id . \', \' . $product_id . \')\" class=\" action-btn like\"><span class=\"svg-wrapper \' . $hart . \'\">\' . RBS::SVG(\'hart_white\') . \'</span></button>\';\n            } else {\n                echo \'<button class=\"like disabled\" style=\"opacity: 0.2\"><span class=\"svg-wrapper \">\' . RBS::SVG(\'hart_white\') . \'</span></button>\';\n            }\n            if(!SHOP::is_my_shop($shop_id)) {\n                if (isset($v[\'IN_BASKET\'])) {\n                    if ($v[\'IN_BASKET\'] === 0) {\n                        echo \'<button onclick=\"in_basket(\\\'\' . $k . \'\\\', this)\" class=\"basket action-btn\">\' . RBS::SVG(\'bag_box.svg\') . \'</button>\';\n                    } else {\n                        echo \'<button onclick=\"in_basket(\\\'\' . $k . \'\\\', this)\" class=\"basket action-btn\">\' . RBS::SVG(\'basket_on.svg\') . \'</button>\';\n                    }\n                }\n            }\n            echo \'</div>\';\n            echo \'<div class=\"price\">\'.VALUES::price_format($v[\'PRICE\']).\' Р</div>\';\n            echo \'<div class=\"location\">\'.$v[\'PLACE\'].\'</div>\';\n            echo \'</div></li>\';\n        } ?>\n    </ul>\n</section>\";', 'php', '2023-12-07 11:02:13', '2', '7'),
