('312', '30', '3', '-1', '0', '0', '0.00000000', '-', '<p><strong>Тамада́</strong>&nbsp;(<a title=\"Грузинский язык\" href=\"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D1%83%D0%B7%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\">груз.</a>&nbsp;<span lang=\"ka\">თამადა</span>, от&nbsp;<a title=\"Персидский язык\" href=\"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D1%81%D0%B8%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\">перс.</a>&nbsp;<span dir=\"rtl\" lang=\"fa\">dāmād</span>&lrm; &laquo;зять, жених&raquo;, по другой версии - от&nbsp;<a title=\"Адыгейский язык\" href=\"https://ru.wikipedia.org/wiki/%D0%90%D0%B4%D1%8B%D0%B3%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\">адыг.</a>&nbsp;<span lang=\"ady\"><a class=\"external text\" href=\"https://en.wiktionary.org/wiki/%D1%82%D1%85%D1%8C%D0%B0%D0%BC%D0%B0%D1%82%D1%8D\">тхьаматэ</a></span>&nbsp;&mdash; &laquo;лидер, начальник&raquo;)&nbsp;&mdash; распорядитель&nbsp;<a title=\"Пир (застолье)\" href=\"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%80_(%D0%B7%D0%B0%D1%81%D1%82%D0%BE%D0%BB%D1%8C%D0%B5)\">пиршества</a>, массового мероприятия, в более узком понимании&nbsp;&mdash; ведущий&nbsp;<a title=\"Свадьба\" href=\"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B0%D0%B4%D1%8C%D0%B1%D0%B0\">свадебной церемонии</a>.</p>\n<p>Тамада, как правило, избирается организаторами либо участниками мероприятия. В обязанности тамады входит установление порядка речей и&nbsp;<a title=\"Тост\" href=\"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D1%81%D1%82\">тостов</a>, организация и контроль выступлений артистов. Тамада не употребляет спиртные напитки сам или употребляет их в гораздо меньшем количестве, чем гости. Во многих странах существовали традиции подобного рода.</p>\n<p>В постсоветское время традиции тамады распространились по всем республикам Советского Союза.</p>', '-'),
